import React, { useState, useEffect } from 'react';
import '../components/RegisterEventDetails.css';

const RegisterEventDetails = ({ eventData }) => {
    const [formData, setFormData] = useState({
        fechaInicio: '',
        horaInicio: '',
        fechaFin: '',
        horaFin: '',
        aperturaPuertas: '',
        modalidad: '',
        nombreLugar: '',
        ciudad: 'Cochabamba',
        enlaceUbicacion: '',
    });

    useEffect(() => {
        // Combinar los datos de la primera vista con los datos de esta vista
        setFormData((prevData) => ({
            ...prevData,
            ...eventData,
        }));
    }, [eventData]);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log('Detalles del evento:', formData);
        // Aquí puedes agregar la lógica para enviar los datos al backend
    };

    return (
        <form className="register-event-details-form" onSubmit={handleSubmit}>
            <h2>Detalles del Evento</h2>

            <label>Fecha y hora de inicio del evento</label>
            <input
                type="date"
                name="fechaInicio"
                value={formData.fechaInicio}
                onChange={handleChange}
                required
            />
            <input
                type="time"
                name="horaInicio"
                value={formData.horaInicio}
                onChange={handleChange}
                required
            />

            <label>Fecha y hora de fin del evento</label>
            <input
                type="date"
                name="fechaFin"
                value={formData.fechaFin}
                onChange={handleChange}
                required
            />
            <input
                type="time"
                name="horaFin"
                value={formData.horaFin}
                onChange={handleChange}
                required
            />

            <label>Apertura de puertas</label>
            <input
                type="time"
                name="aperturaPuertas"
                value={formData.aperturaPuertas}
                onChange={handleChange}
            />

            <label>Modalidad</label>
            <div>
                <label>
                    <input
                        type="radio"
                        name="modalidad"
                        value="Presencial"
                        checked={formData.modalidad === 'Presencial'}
                        onChange={handleChange}
                    />
                    Presencial
                </label>
                <label>
                    <input
                        type="radio"
                        name="modalidad"
                        value="Virtual"
                        checked={formData.modalidad === 'Virtual'}
                        onChange={handleChange}
                    />
                    Virtual
                </label>
                <label>
                    <input
                        type="radio"
                        name="modalidad"
                        value="Híbrido"
                        checked={formData.modalidad === 'Híbrido'}
                        onChange={handleChange}
                    />
                    Híbrido
                </label>
            </div>

            <label>Nombre del lugar</label>
            <input
                type="text"
                name="nombreLugar"
                placeholder="Nombre del lugar"
                value={formData.nombreLugar}
                onChange={handleChange}
                required
            />

            <label>Ciudad</label>
            <select
                name="ciudad"
                value={formData.ciudad}
                onChange={handleChange}
                required
            >
                <option value="Cochabamba">Cochabamba</option>
                <option value="La Paz">La Paz</option>
                <option value="Santa Cruz">Santa Cruz</option>
                <option value="Sucre">Sucre</option>
                <option value="Pando">Pando</option>
            </select>

            <label>Link de la ubicación (Google Maps)</label>
            <input
                type="url"
                name="enlaceUbicacion"
                placeholder="Enlace de Google Maps"
                value={formData.enlaceUbicacion}
                onChange={handleChange}
            />

            <button type="submit">Guardar</button>
        </form>
    );
};

export default RegisterEventDetails;
